import React from 'react';
import { useNavigate } from 'react-router-dom';

const Contact = () => {
  const navigate = useNavigate();
  const goToAbout = () => {
    navigate('/about');
  };
  return (
    <>
      <h1>My Contact Pge</h1>
      <button onClick={goToAbout}>Go to About Page</button>
    </>
  );
};

export default Contact;
